import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Rating = ({ role, reportId }) => {
  const [items, setItems] = useState([]); // students or lectures
  const [ratings, setRatings] = useState({});
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  const token = localStorage.getItem('token');

  // Fetch items based on role
  const fetchItems = async () => {
    if (!token) return;

    try {
      let url = '';
      if (role === 'lecturer') url = '/api/students-to-rate';
      else if (role === 'student') url = '/api/lectures-to-rate';
      else if (role === 'prl') url = '/api/rating'; // PRL sees all ratings

      const res = await axios.get(url, {
        headers: { 'x-auth-token': token }
      });

      if (role === 'prl') {
        // For PRL, show existing ratings
        setItems(res.data.ratings || []);
      } else {
        setItems(res.data || []);
      }
    } catch (err) {
      console.error('Fetch items error:', err);
      setError('Error fetching items');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchItems();
  }, []);

  const handleChange = (id, value) => {
    setRatings(prev => ({ ...prev, [id]: value }));
  };

  const handleSubmit = async (id) => {
    if (!ratings[id]) return;

    try {
      let url = '/api/rating';
      let body = {};

      if (role === 'lecturer') {
        body = { target_id: id, rating: ratings[id] };
      } else if (role === 'student') {
        body = { target_id: id, rating: ratings[id] };
      }

      await axios.post(url, body, {
        headers: { 'x-auth-token': token }
      });

      alert('Rating submitted!');
      fetchItems();
      setRatings(prev => ({ ...prev, [id]: '' }));
    } catch (err) {
      console.error('Submit rating error:', err);
      alert('Error submitting rating');
    }
  };

  if (loading) return <p>Loading...</p>;
  if (error) return <p style={{ color: 'red' }}>{error}</p>;

  return (
    <div>
      {role === 'prl' ? (
        <div>
          <h4>All Ratings</h4>
          {items.length ? (
            <ul>
              {items.map(item => (
                <li key={item.id}>
                  <strong>Student:</strong> {item.student_name} |{' '}
                  <strong>Lecturer:</strong> {item.lecturer_name} |{' '}
                  <strong>Lecture ID:</strong> {item.lecture_id || 'N/A'} |{' '}
                  <strong>Rating:</strong> {item.rating || 'N/A'} |{' '}
                  <strong>Comment:</strong> {item.comment || 'N/A'}
                </li>
              ))}
            </ul>
          ) : (
            <p>No ratings yet.</p>
          )}
        </div>
      ) : (
        <div>
          {items.length ? (
            <ul>
              {items.map(item => (
                <li key={item.id}>
                  <span>
                    {role === 'lecturer' ? item.username : item.lecturer_name}
                  </span>
                  <input
                    type="number"
                    min="1"
                    max="5"
                    value={ratings[item.id] || ''}
                    onChange={(e) => handleChange(item.id, e.target.value)}
                  />
                  <button onClick={() => handleSubmit(item.id)}>Submit</button>
                </li>
              ))}
            </ul>
          ) : (
            <p>No items to rate.</p>
          )}
        </div>
      )}
    </div>
  );
};

export default Rating;
